import React from "react";

type MyProps = {
  message: string;
};
type MyState = {
  count: number;
};

class Home extends React.Component<MyProps, MyState> {
  state: MyState = {
    count: 2
  }

  render() {
    return (
      <div className="container">
        <div className="row blue-grey lighten-2 z-depth-2">
          <h1 className="m1">{this.props.message}: {this.state.count}</h1>
          <a href="#!" className="btn waves-effect">Send</a>
        </div>
      </div>
    );
  }
}

export default Home;
